// SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.0;

contract Token{
    // Define name of token. Public to see its value.
    string public name; //State variable, value stored in the blockchain. 
    // Define symbol
    string public symbol;
    // Define decimals
    uint256 public decimals = 18;
    // Define supply
    uint256 public totalSupply;

    // TRACK BALANCES //
    // Define mapping structure to link key Address and value int of type uint256
    mapping(address=>uint256) public balanceOf;

    // mapping 
    mapping(address=>mapping(address=>uint256)) public allowance;

    // EVENTS
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    // Create constructor
    constructor(
        string memory _name, 
        string memory _symbol, 
        uint256 _totalsupp
    ){
        name = _name; // Specify token name
        symbol = _symbol; // Specify token symbol
        totalSupply = _totalsupp * (10 ** decimals); // Specify token total supply
        balanceOf[msg.sender] = totalSupply; // Send all tokens created (totalSupply) to the balance address that is deploying the smart contract
    }

    // TRANSFER TOKENS
    function transfer( address _to, uint256 _value )
        public 
        returns( bool success )
    {   
        // Require that sender has enough tokens to send
        require(balanceOf[msg.sender] >= _value);

        _transfer(msg.sender, _to, _value);

        return true;
    }

    function approve(address _spender, uint256 _value) 
        public
        returns(bool success)
    {   
        require(_spender != address(0));
        // double mapping (nested mapping)
        allowance[msg.sender][_spender] = _value;
        // emit event
        emit Approval(msg.sender, _spender, _value);

        return true;
    }

    // internal function, only can be called from inside the smart contract
    function _transfer(address _from, address _to, uint256 _value) internal{
        // requires
        require(_to != address(0));

        // Deduct tokens from spender (msg.sender)
        balanceOf[_from] = balanceOf[_from] - _value;
        balanceOf[_to] = balanceOf[_to] + _value;

        // emit event
        emit Transfer(_from, _to, _value);
    }

    function transferFrom(address _from, address _to, uint256 _value)
        public
        returns(bool success)
    {
        // CHECK APPROVAL
        require(_value <= balanceOf[_from]); // check that spender has funds
        require(_value <= allowance[_from][msg.sender]); // value spend is less or equal thant the allowed

        // reset allowance
        allowance[_from][msg.sender] = allowance[_from][msg.sender] - _value; // update value allowed to spend

        // SPEND TOKEN
        _transfer(_from, _to, _value);

        return true;
    }
}
